import React from "react";
import TextField from "./TextField";
import AddBtn from "./AddBtn";


const AddBlog = () => {
  return (
    <>
    <h1 className="text-center m-5">ADD BLOG</h1>
    <form style={{ marginLeft: "554px", marginTop: "70px" }}>
      <div class="mb-3">
        <TextField label="Title: " inputs={{ type: "text" }} />
      </div>
      <div class="mb-3">
        <TextField label="Content: " inputs={{ type: "text" }} />
      </div>
      <AddBtn>Add</AddBtn>
    </form>
    </>
  );
};

export default AddBlog;
